import React, { useRef } from 'react'
import { useGLTF } from '@react-three/drei'
import {useFrame, useLoader} from "@react-three/fiber";
import {TextureLoader} from "three";

export function Model(props) {

  const [stone] = useLoader(TextureLoader, [
    'paper.webp'
  ])

  const group = useRef()
  const { nodes, materials } = useGLTF('/Ethereum/Ethereum.gltf')

  useFrame(() => {
    group.current.rotation.y += 0.01;
  }, [])

  return (
    <group ref={group} {...props} dispose={null}>
      <group name="Scene">
        <mesh name="Ethereum" geometry={nodes.Ethereum.geometry} material={materials['Material.006']} position={[0, 1.21, 0]}>
          <meshStandardMaterial map={stone}/>
        </mesh>
      </group>
    </group>
  )
}

useGLTF.preload('/Ethereum/Ethereum.gltf')
